import React from "react";
import "date-fns";
import {
  Paper,
  Box,
  Typography,
  Divider,
  Container,
  InputLabel,
  Select,
  FormControl,
  FormHelperText,
  MenuItem,
  Grid,
  Button,
} from "@material-ui/core";
import { Table, TextField, CircularProgress } from "@material-ui/core";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TablePagination from "@material-ui/core/TablePagination";
import TableRow from "@material-ui/core/TableRow";
import TableSortLabel from "@material-ui/core/TableSortLabel";
import Toolbar from "@material-ui/core/Toolbar";
import { connect } from "react-redux";
import { ThemeProvider } from "@material-ui/core/styles";
import { theme } from "../../theme/light";
import { withStyles } from "@material-ui/core/styles";
import DateFnsUtils from "@date-io/date-fns";
import {
  MuiPickersUtilsProvider,
  KeyboardTimePicker,
  KeyboardDatePicker,
} from "@material-ui/pickers";
import UserService from "../../services/user.service";
import moment from "moment";

const useStyles = (theme) => ({
  root: {
    "& > *": {
      marginTop: theme.spacing(4),
    },
  },
  roots: {
    width: "100%",
  },
  paper: {
    width: "100%",
  },
  papers: {
    width: "100%",
    marginBottom: theme.spacing(2),
  },

  formControl: {
    marginTop: theme.spacing(2),
    minWidth: 300,
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
});

const headCells = [
  {
    id: "facilityName",
    numeric: false,
    disablePadding: false,
    label: "Facility Name",
  },
  {
    id: "vehicleType",
    numeric: false,
    disablePadding: false,
    label: "Vehicle Type",
  },
  {
    id: "checkin",
    numeric: false,
    disablePadding: false,
    label: "Total Check In",
  },
  {
    id: "checkout",
    numeric: false,
    disablePadding: false,
    label: "Total Check Out",
  },
  // {
  //   id: "facilityName",
  //   numeric: false,
  //   disablePadding: false,
  //   label: "Facility Name",
  // },
  // { id: "city", numeric: false, disablePadding: false, label: "Email" },
  // {
  //   id: "description",
  //   numeric: false,
  //   disablePadding: false,
  //   label: "Description",
  // },
];

const paymentHeadCells = [
  {
    id: "online",
    numeric: false,
    disablePadding: false,
    label: "Online",
  },
  {
    id: "cash",
    numeric: false,
    disablePadding: false,
    label: "Cash",
  },
  {
    id: "exempt",
    numeric: false,
    disablePadding: false,
    label: "Exempt",
  },
];
let rows = [];
function EnhancedTableHead(props) {
  const {
    classes,
    onSelectAllClick,
    order,
    orderBy,
    numSelected,
    rowCount,
    onRequestSort,
  } = props;
  const createSortHandler = (property) => (event) => {
    onRequestSort(event, property);
  };

  return (
    <TableHead>
      <TableRow>
        {/* <TableCell padding="checkbox">
          <Checkbox
            indeterminate={numSelected > 0 && numSelected < rowCount}
            checked={rowCount > 0 && numSelected === rowCount}
            onChange={onSelectAllClick}
            inputProps={{ "aria-label": "select all desserts" }}
          />
        </TableCell> */}
        {headCells.map((headCell) => (
          <TableCell
            key={headCell.id}
            align={headCell.numeric ? "right" : "left"}
            padding={headCell.disablePadding ? "none" : "normal"}
            sortDirection={orderBy === headCell.id ? order : false}
          >
            <TableSortLabel
              active={orderBy === headCell.id}
              direction={orderBy === headCell.id ? order : "asc"}
              onClick={createSortHandler(headCell.id)}
            >
              {headCell.label}
              {orderBy === headCell.id ? (
                <span className={classes.visuallyHidden}>
                  {order === "desc" ? "sorted descending" : "sorted ascending"}
                </span>
              ) : null}
            </TableSortLabel>
          </TableCell>
        ))}
      </TableRow>
    </TableHead>
  );
}

function descendingComparator(a, b, orderBy) {
  if (b[orderBy] < a[orderBy]) {
    return -1;
  }
  if (b[orderBy] > a[orderBy]) {
    return 1;
  }
  return 0;
}

function getComparator(order, orderBy) {
  console.log("getComparator", order);
  return order === "desc"
    ? (a, b) => descendingComparator(a, b, orderBy)
    : (a, b) => -descendingComparator(a, b, orderBy);
}

function stableSort(array, comparator) {
  const stabilizedThis = array.map((el, index) => [el, index]);
  stabilizedThis.sort((a, b) => {
    const order = comparator(a[0], b[0]);
    if (order !== 0) return order;
    return a[1] - b[1];
  });
  return stabilizedThis.map((el) => el[0]);
}

class Home extends React.PureComponent {
  constructor(props) {
    super(props);
    this.state = {
      age: "",
      startDate: new Date(),
      endDate: new Date() + 1,
      deviceuniqueid: "Web",
      token: "339CFB64EDC6E94C5577CD68319E72AB6732C711AE661427AC83931B33F05CC4",
      mappingList: [],
      consolidates: "",
      type: "Daily",
      facilityid: "",
      dailyReport: [],
      selected: [],
      order: "asc",
      orderBy: "calories",
      selected: [],
      page: 0,
      rowsPerPage: 10,
      names: [],
      facility: "",
      facilityName: "Consolidate",
      totalCheckIn: 0,
      totalCheckOut: 0,
      totalCash: 0,
      totalOnline: 0,
      totalNoCash: 0,
    };
  }

  componentDidMount() {
    const { userDetails } = this.props;
    const { loginToken } = userDetails;
    this.setState(
      {
        token: loginToken,
        facilityid: "34",
      },
      () => {
        this.getRefreshMapping();
        this.getDailyAdminParkingStatusReport(new Date());
      }
    );
  }

  getRefreshMapping = async () => {
    const { deviceuniqueid, token } = this.state;

    try {
      const response = await UserService.mapping(deviceuniqueid, token);
      const { status, data } = response;
      const { groupmapping } = data;
      const { data: list } = groupmapping;
      console.log("response after getRefreshMapping --> ", response);
      if (data && list.length > 0) {
        let id = [];
        let names = [];
        list.map((item, index) => {
          id.push(item.instanceid);
          names.push(item.name);
        });
        id = id.join(",");
        this.setState({
          mappingList: list,
          consolidates: id,
          names,
        });
      }
    } catch (error) {
      console.log("error getRefreshMapping", error);
    }
  };

  getDailyAdminParkingStatusReport = async (inputdate) => {
    const { token, facilityid } = this.state;
    let inputdatetime = moment(inputdate).format("DD-MMM-YYYY"); // 01-Oct-2022

    try {
      const response = await UserService.AdminParkingStatusReport(
        facilityid,
        token,
        "01-Oct-2022"
      );

      console.log("response after getDailyAdminParkingStatusReport ", response);
      const { data: res } = response;
      if (res.respCode === 1 && res) {
        const { checkin, checkout, payment } = res;

        let totalcheckin = 0;
        let totalcheckout = 0;
        let totalPayment = 0;
        let totalVehicle = 0;
        let carIn = 0;
        let carOut = 0;
        let bikeIn = 0;
        let bikeOut = 0;
        let bicycleIn = 0;
        let bicycleOut = 0;
        let autoIn = 0;
        let autoOut = 0;

        let vehicleArray = [];
        const vechicles = {
          1: "Bike",
          2: "Car",
          3: "Auto",
          4: "Bicycle",
        };
        if (checkin) {
          for (let i = 0; i < checkin.length; i++) {
            const { vehicletype, vehiclecount } = checkin[i];
            const vehicleName = vechicles[vehicletype];
            const ifExist = vehicleArray.findIndex(
              (value, index) => value === vehicleName
            );
            if (ifExist == -1) {
              vehicleArray.push(vehicleName);
            }

            carIn = vehicleName == "Car" ? vehiclecount : carIn;
            bikeIn = vehicleName == "Bike" ? vehiclecount : bikeIn;
            bicycleIn = vehicleName == "Bicycle" ? vehiclecount : bicycleIn;
            autoIn = vehicleName == "Auto" ? vehiclecount : autoIn;

            totalcheckin = totalcheckin + vehiclecount;
          }
          console.log("checkin data", carIn);
        }
        if (checkout) {
          for (let i = 0; i < checkout.length; i++) {
            const { vehicletype, vehiclecount } = checkout[i];
            const vehicleName = vechicles[vehicletype];
            const ifExist = vehicleArray.findIndex(
              (value, index) => value === vehicleName
            );
            if (ifExist == -1) {
              vehicleArray.push(vehicleName);
            }

            carOut = vehicleName == "Car" ? vehiclecount : carOut;
            bikeOut = vehicleName == "Bike" ? vehiclecount : bikeOut;
            bicycleOut = vehicleName == "Bicycle" ? vehiclecount : bicycleOut;
            autoOut = vehicleName == "Auto" ? vehiclecount : autoOut;

            totalcheckout = totalcheckout + vehiclecount;
          }
        }

        const paymentValue = {
          2: "Cash",
          3: "Online",
          5: "Exempt",
        };
        let paymentArray = [];
        // let colorArray = [(opacity = 1) => `#2E7D32`,(opacity = 1) => `#FD0002`,(opacity = 1) => `#00266B`];
        let colorArray = [];

        let amountArray = [];
        let cashCount = 0;
        let onlineCount = 0;
        let noCashCount = 0;

        if (payment) {
          for (let i = 0; i < payment.length; i++) {
            const { paymentmode, amountcollected } = payment[i];
            const paymentName = paymentValue[paymentmode];
            const ifExist = paymentArray.findIndex(
              (value, index) => value === paymentName
            );
            if (ifExist == -1) {
              paymentArray.push(paymentName);
            }

            cashCount =
              paymentName == "Cash" ? amountcollected / 100 : cashCount;
            onlineCount =
              paymentName == "Online" ? amountcollected / 100 : onlineCount;
            noCashCount =
              paymentName == "Exempt" ? amountcollected / 100 : noCashCount;

            if (cashCount !== 0) {
              amountArray.push(cashCount);
            } else if (onlineCount !== 0) {
              amountArray.push(onlineCount);
            } else if (noCashCount !== 0) {
              amountArray.push(noCashCount);
            }
            if (paymentmode === 2) {
              colorArray.push((opacity = 1) => `#2E7D32`);
            } else if (paymentmode === 3) {
              colorArray.push((opacity = 1) => `#FD0002`);
            } else if (paymentmode === 5) {
              colorArray.push((opacity = 1) => `#00266B`);
            }
            if (paymentmode !== 5) {
              totalPayment = totalPayment + amountcollected / 100;
            }
          }
        }

        let finalArray = [];

        let objCar = {
          name: "Car",
          totalin: carIn,
          totalout: carOut,
        };
        finalArray.push(objCar);
        let objBike = {
          name: "Bike",
          totalin: bikeIn,
          totalout: bikeOut,
        };
        finalArray.push(objBike);
        let objBicycle = {
          name: "Bicycle",
          totalin: bicycleIn,
          totalout: bicycleOut,
        };
        finalArray.push(objBicycle);

        this.setState({
          dailyReport: finalArray,
          totalCheckIn: totalcheckin,
          totalCheckOut: totalcheckout,
          totalCash: cashCount,
          totalOnline: onlineCount,
          totalNoCash: noCashCount,
        });
      }
    } catch (error) {
      console.log("error getDailyAdminParkingStatusReport", error);
    }
  };

  handleChange = (event) => {
    const { mappingList } = this.state;
    let name = "";
    for (let i = 0; i < mappingList.length; i++) {
      if (event.target.value === mappingList[i]["instanceid"]) {
        name = mappingList[i]["name"];
      }
    }
    if (!name) {
      name = "Consolidate";
    }
    console.log("name", name);
    this.setState({
      facility: event.target.value,
      facilityName: name,
    });
  };

  handleTypeChange = (event) => {
    this.setState({
      type: event.target.value,
    });
  };

  handleDateChange = (date) => {
    console.log(date);
    this.setState({
      startDate: date,
      endDate: date + 1,
    });
  };
  handleEndDateChange = (date) => {
    this.setState({
      endDate: date,
    });
  };

  handleRequestSort = (event, property) => {
    const { orderBy, order } = this.state;
    const isAsc = orderBy === property && order === "asc";
    this.setState({
      order: isAsc ? "desc" : "asc",
    });
    this.setState({
      orderBy: property,
    });
  };

  handleSelectAllClick = (event) => {
    const { allBranch } = this.state;
    if (event.target.checked) {
      const newSelecteds = allBranch.map((n) => n.id);

      this.setState({
        selected: newSelecteds,
      });
      return;
    }
    this.setState({ selected: [] });
  };

  handleClick = (event, name) => {
    const { selected } = this.state;
    console.log(selected);
    const selectedIndex = selected.indexOf(name);
    let newSelected = [];

    if (selectedIndex === -1) {
      newSelected = newSelected.concat(selected, name);
    } else if (selectedIndex === 0) {
      newSelected = newSelected.concat(selected.slice(1));
    } else if (selectedIndex === selected.length - 1) {
      newSelected = newSelected.concat(selected.slice(0, -1));
    } else if (selectedIndex > 0) {
      newSelected = newSelected.concat(
        selected.slice(0, selectedIndex),
        selected.slice(selectedIndex + 1)
      );
    }

    this.setState({
      selected: newSelected,
    });
  };

  handleChangePage = (event, newPage) => {
    this.setState({ page: newPage });
  };

  handleChangeRowsPerPage = (event) => {
    this.setState({ rowsPerPage: parseInt(event.target.value, 10) });

    this.setState({ page: 0 });
  };

  render() {
    const { classes } = this.props;
    const {
      facility,
      startDate,
      endDate,
      mappingList,
      type,
      rowsPerPage,
      page,
      selected,
      orderBy,
      order,
      dailyReport,
      facilityName,
      totalCheckIn,
      totalCheckOut,
    } = this.state;
    const rows = type === "Daily" ? dailyReport : [];
    const emptyRows =
      rowsPerPage -
      Math.min(rowsPerPage, dailyReport.length - page * rowsPerPage);

    const isSelected = (id) => selected.indexOf(id) !== -1;

    console.log("mappingList", mappingList, " type", type);
    return (
      <ThemeProvider theme={theme}>
        <Box className="container" p={2.5} bgcolor="primary.lightBgContainer">
          <Paper className="content lead-page">
            <Box className="page-heading" mb={3}>
              <Box color="text.secondary" pt={3} pr={2.7} pb={1.8} pl={3}>
                <Typography variant="h6" gutterBottom color="inherit">
                  Dashboard
                </Typography>
              </Box>
              <Divider />
            </Box>
            <MuiPickersUtilsProvider utils={DateFnsUtils}>
              <Grid container justifyContent="space-evenly">
                <FormControl variant="standard" className={classes.formControl}>
                  <InputLabel htmlFor="age-native-simple">
                    Select Facility
                  </InputLabel>
                  <Select
                    native
                    value={facility}
